function setCookie(e,o,t){if(3!=arguments.length)throw new Error("setCookie() take 3 parameter, 'cookieName', 'cookieValue' and 'expiryDate'");var r=new Date(t);document.cookie=`${e} = ${o}; expires= ${r}`}function allCookieList(){var e=document.cookie.split(";"),o=[];for(const r of e){var t=r.split("=");o[t[0].trim()]=t[1]}return o}function getCookie(e){if(1!=arguments.length)throw new Error("getCookie() take 1 parameter, 'cookieName'");for(const o in allCookieList())if(o==e)return allCookieList()[o]}function hasCookie(e){if(1==arguments.length)return allCookieList().hasOwnProperty(e);throw new Error("hasCookie() take 1 parameter, 'cookieName'")}function deleteCookie(e){if(1!=arguments.length)throw new Error("deleteCookie() take 1 parameter, 'cookieName'");hasCookie(e)&&(document.cookie=`${e}=; expires=;`)}var registerBtun=document.querySelector("button");registerBtun.addEventListener("click",(function(){var e=document.getElementsByTagName("input");""!=e[0].value&&setCookie("name",e[0].value,"2022-09-29");for(var o=document.getElementsByName("gender"),t=0;t<o.length;t++){if(o[t].checked)setCookie("gender",o[t].value,"2022-09-29")}var r=document.getElementsByTagName("select")[0];for(t=0;t<r.length;t++){if(r[t].selected)setCookie("color",r.options[t].value,"2022-09-29")}alert("Registration Done!")}));